 Simples Nacional','Receita Federal',0.15,0.18,'Pessoa Jurídica Simples Nacional\r\n\r\nRetorna as seguintes informações:\r\n\r\nOptante do Simples Nacional (SINAC)\r\nOptante do MEI (SIMEI)\r\nData da Opção do Simples Nacional\r\nData da Opção do MEI\r\nPeriodos de opção',1,'receita-federal-pessoa-juridica-simples-nacional','cdc.asmx?op=PessoaJuridicaSimplesNacional','2017-10-31 11:42:34','2017-10-31 11:42:34'),(9,'PEFIN - Pendências Financeiras','SERASA Experian',6.87,8.25,'PEFIN - Consulta Pendencias Financeiras\r\n\r\nRetorna se existem restrições ou não para o CPF/CNPJ informado com DETALHAMENTO de cada ocorrência.\r\n\r\n\r\nSintese Cadastral\r\nAlerta de Documentos Roubados\r\nRestriçõe',1,'serasa-experian-pefin','pefin.ashx','2017-11-02 08:16:49','2017-11-02 08:16:49'),(10,'CREDNET - Pendências Financeiras + Cartórios Estaduais','SERASA Experian',9.45,11.35,'CREDNET - Consulta Pendencias Financeiras + Protestos Estaduais de CPF/CNPJ\r\n\r\nRetorna se existem restrições ou não para o CPF/CNPJ informado com DETALHAMENTO de cada ocorrência.',1,'serasa-experian-crednet','crednet.ashx','2017-11-02 08:20:00','2017-11-02 08:20:00'),(11,'CREDNET - ESTENDIDA - Pendências Financeiras + Cartórios Estaduais + Opcionais','SERASA Experian',9.45,11.35,'Retorna se existem restrições ou não para o CPF/CNPJ informado com DETALHAMENTO de cada ocorrência.\r\n\r\n\r\nSintese Cadastral\r\nAlerta de Documentos Roubados\r\nRestrições\r\nPendências Internas SERASA\r\nPendências F',1,'serasa-experian-crednet-estendida','crednet.asmx?op=CredNetEstendida','2017-11-02 08:21:58','2017-11-02 08:21:58'),(12,'CONCENTRE - Consulta CONCENTRE CPF/CNPJ','SERASA Experian',19.98,23.98,'Consulta CONCENTRE de um CPF/CNPJ DETALHAMENTO de cada ocorrência.\r\n\r\nSintese Cadastral\r\nGrafias\r\nProtestos, Ações Judiciais, Falências e Concordatas, Participações em Empresas com Falências e Concordatas',1,'serasa-experian-concentre','concentre.asmx?op=Concentre','2017-11-02 08:23:15','2017-11-02 08:23:15